@Override
public int hashCode() {
  int hash = classHash();
  hash = 31 * hash + field.hashCode();
  hash = 31 * hash + numDims;
  hash = 31 * hash + queryType.hashCode();
  hash = 31 * hash + Arrays.hashCode(ranges);

  return hash;
}

